import React from "react";


export default function Card() {
    return (
        <div className="card">
            <div className="top">
                <h2 className="name">Ryan Reynolds</h2>
                <img
                    className="circle-img"
                    src="https://bit.ly/3wkAfAl"
                    alt="avatar_img"
                />
            </div>
            <div className="bottom">
                <p className="info">+123 456 789</p>
                <p className="info">R@Reynolds.com</p>
            </div>
        </div>
    );
}
